<style>
* { box-sizing: border-box; margin: 0; padding: 0; }
body { font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif; background: #f5f5f5; color: #333; }

.header {
  background: #fff; border-bottom: 1px solid #ddd; padding: 16px 24px;
  position: sticky; top: 0; z-index: 100;
  display: flex; align-items: center; gap: 16px; flex-wrap: wrap;
}
.header h1 { font-size: 20px; font-weight: 700; white-space: nowrap; }
.header .stats { color: #666; font-size: 14px; }

.filters {
  display: flex; gap: 8px; flex-wrap: wrap; align-items: center;
  margin-left: auto;
}
.filters select, .filters input {
  padding: 6px 10px; border: 1px solid #ccc; border-radius: 6px;
  font-size: 13px; background: #fff;
}
.filters input[type="number"] { width: 90px; }
.filters label { font-size: 13px; color: #555; }

.sort-bar {
  background: #fff; border-bottom: 1px solid #eee; padding: 8px 24px;
  display: flex; gap: 12px; align-items: center; font-size: 13px; color: #666;
}
.sort-bar button {
  background: none; border: none; cursor: pointer; font-size: 13px;
  color: #666; padding: 4px 8px; border-radius: 4px;
}
.sort-bar button:hover { background: #eee; }
.sort-bar button.active { color: #006aff; font-weight: 600; }

.grid {
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(320px, 1fr));
  gap: 16px; padding: 16px 24px; max-width: 1600px; margin: 0 auto;
}

.card {
  background: #fff; border-radius: 10px; overflow: hidden;
  box-shadow: 0 1px 4px rgba(0,0,0,0.08);
  transition: box-shadow 0.2s, transform 0.15s;
  cursor: pointer;
}
.card:hover { box-shadow: 0 4px 16px rgba(0,0,0,0.15); transform: translateY(-2px); }

.card-img {
  width: 100%; height: 200px; object-fit: cover; background: #e0e0e0;
  display: block;
}
.card-img-placeholder {
  width: 100%; height: 200px; background: linear-gradient(135deg, #e8e8e8, #d0d0d0);
  display: flex; align-items: center; justify-content: center;
  color: #999; font-size: 14px;
}

.card-body { padding: 12px 14px; }
.card-price { font-size: 22px; font-weight: 700; color: #222; }
.card-cf {
  display: inline-block; font-size: 13px; font-weight: 600;
  padding: 2px 8px; border-radius: 4px; margin-left: 8px;
}
.card-cf.positive { background: #e6f9e6; color: #1a7a1a; }
.card-cf.negative { background: #fce8e8; color: #c00; }

.card-details { font-size: 14px; color: #444; margin-top: 4px; }
.card-details span { margin-right: 6px; }
.card-address { font-size: 13px; color: #666; margin-top: 4px; }
.card-meta {
  display: flex; gap: 8px; flex-wrap: wrap; margin-top: 6px;
  font-size: 12px; color: #888;
}
.card-meta .tag {
  background: #f0f0f0; padding: 2px 6px; border-radius: 3px;
}
.card-meta .tag.rent-src-radius { background: #e8f4e8; color: #2a7a2a; }
.card-meta .tag.rent-src-radius_wide { background: #fff3cd; color: #856404; }
.card-meta .tag.rent-src-metro { background: #fce8e8; color: #c00; }

.count-display { padding: 8px 24px; font-size: 13px; color: #666; background: #fff; border-bottom: 1px solid #eee; }

@media (max-width: 720px) {
  .grid { grid-template-columns: 1fr; padding: 12px; gap: 12px; }
  .header { padding: 12px; }
  .filters { margin-left: 0; }
}
</style>
</head>

function fmt$(n) { return '$' + n.toLocaleString(); }
function fmtCF(n) { return (n >= 0 ? '+' : '') + '$' + Math.abs(n).toLocaleString() + '/mo'; }

// Populate city filter
const cities = [...new Set(LISTINGS.map(l => l.city))].sort();
const citySelect = document.getElementById('filterCity');
cities.forEach(c => { const o = document.createElement('option'); o.value = c; o.textContent = c; citySelect.appendChild(o); });

function getFiltered() {
  const city = document.getElementById('filterCity').value;
  const beds = document.getElementById('filterBeds').value;
  const minCF = parseInt(document.getElementById('filterMinCF').value) || 0;
  const maxPrice = parseInt(document.getElementById('filterMaxPrice').value) || 999999999;
  return LISTINGS.filter(l =>
    (!city || l.city === city) &&
    (!beds || l.beds == beds) &&
    l.cf >= minCF &&
    l.price <= maxPrice
  );
}

let currentSort = 'cf-desc';
function sortListings(arr) {
  const copy = [...arr];
  switch(currentSort) {
    case 'cf-desc': return copy.sort((a,b) => b.cf - a.cf);
    case 'cf-asc': return copy.sort((a,b) => a.cf - b.cf);
    case 'price-asc': return copy.sort((a,b) => a.price - b.price);
    case 'price-desc': return copy.sort((a,b) => b.price - a.price);
    case 'cocr-desc': return copy.sort((a,b) => (b.cocr||0) - (a.cocr||0));
  }
  return copy;
}

function render() {
  const filtered = sortListings(getFiltered());
  document.getElementById('countDisplay').textContent = filtered.length;
  const grid = document.getElementById('grid');
  grid.innerHTML = filtered.map(l => {
    const imgHtml = l.photo_url
      ? `<img class="card-img" src="${l.photo_url}" alt="${l.address}" loading="lazy" onerror="this.outerHTML='<div class=card-img-placeholder>No Photo</div>'">`
      : `<div class="card-img-placeholder">No Photo</div>`;
    const cfClass = l.cf >= 0 ? 'positive' : 'negative';
    const srcClass = 'rent-src-' + (l.rent_source || '').replace(/[^a-z_]/g, '');
    const hoa = l.hoa_fee ? `HOA $${l.hoa_fee}` : '';
    const stories = l.stories ? l.stories + '-story' : '';
    const yr = l.year_built ? 'Built ' + l.year_built : '';
    const lot = l.lot_sqft ? (l.lot_sqft/43560).toFixed(2) + 'ac' : '';
    const cocr = l.cocr ? l.cocr.toFixed(1) + '% CoC' : '';
    const tags = [yr, stories, lot, hoa, cocr, l.rent_source ? l.comp_count + ' comps (' + l.rent_source + ')' : ''].filter(Boolean).map(String);
    return `
    <div class="card" onclick="window.open('${l.url}','_blank')">
      ${imgHtml}
      <div class="card-body">
        <span class="card-price">${fmt$(l.price)}</span>
        <span class="card-cf ${cfClass}">${fmtCF(l.cf)}</span>
        <div class="card-details">
          <span>${l.beds}bd</span>
          <span>${l.baths}ba</span>
          <span>${l.sqft.toLocaleString()} sqft</span>
          <span>Est rent ${fmt$(l.est_rent)}</span>
        </div>
        <div class="card-address">${l.address}, ${l.city} ${l.zip}</div>
        <div class="card-meta">
          ${tags.map(t => `<span class="tag ${t.includes('comps') ? srcClass : ''}">${t}</span>`).join('')}
        </div>
      </div>
    </div>`;
  }).join('');
}

// Event listeners
document.querySelectorAll('.sort-bar button').forEach(btn => {
  btn.addEventListener('click', () => {
    document.querySelectorAll('.sort-bar button').forEach(b => b.classList.remove('active'));
    btn.classList.add('active');
    currentSort = btn.dataset.sort;
    render();
  });
});
['filterCity','filterBeds','filterMinCF','filterMaxPrice'].forEach(id => {
  document.getElementById(id).addEventListener('input', render);
});

try { render(); } catch(e) { document.getElementById('grid').innerHTML = '<p style="padding:24px;color:red">Error: ' + e.message + '</p>'; console.error(e); }
</script>
